/*!
 * Built with Duet Design System
 */
import { formatViolations, options as axeRunOptions, testWithAxe } from "../../utils/axe-core-utils";
describe("[a11y] duet-submenu-bar", () => {
    it("should render an accessible component", async () => {
        const result = await testWithAxe(`
         <duet-submenu-bar>
         <span slot="label">Näytä vaihtoehdot</span>
          <duet-submenu-bar-dropdown icon="category-car">
            <span slot="label">Ajoneuvot</span>
            <duet-submenu-bar-dropdown-link>Autovakuutus</duet-submenu-bar-dropdown-link>
            <duet-divider margin="none"></duet-divider>
            <duet-submenu-bar-dropdown-link caret highlight>Kaikki ajoneuvovakuutukset</duet-submenu-bar-dropdown-link>
          </duet-submenu-bar-dropdown>
        </duet-submenu-bar>
      `, axeRunOptions);
        expect(result).not.toBeNull();
        expect(formatViolations(result.violations)).toEqual([]);
    });
});
